import StickyFooter from 'react-sticky-footer';
import Link from 'next/link';
import Carticon from './carticon/Carticon';
const Footer = () =>{
    return(
        <StickyFooter bottomThreshold={50} normalStyles={{backgroundColor: "#d0d3d4",padding: "2rem",align:"centers"}}
        stickyStyles={{backgroundColor: "rgba(255,255,255,.8)",padding: "2rem",width:"100%"}}>
            <nav className="navbar navbar-expand-lg navbar-light ">
                <div className="row">
                        <a href="/Shop" className="colf"><i className="ti ti-layout-grid2"></i></a>
                        <a href="/Shop" className="colf"><i className="ti ti-heart"></i></a>
                        <a href="/Shop" className="colf"><Carticon /></a>
                        <a href="/Shop" className="colf"><i className="ti ti-user"></i></a>
                    </div>
            </nav>
        </StickyFooter>
    );
}
export default Footer;
